import mockApi from './mockApi';

export const workoutsService = {
  async list() {
    const { data } = await mockApi.getWorkouts();
    return data;
  },

  async create(workout) {
    const { data } = await mockApi.createWorkout(workout);
    return data;
  },

  async getById(id) {
    // Mock get by ID
    return { data: { id, name: 'Mock Workout', exercises: [] } };
  },

  async update(id, workout) {
    const { data } = await mockApi.createWorkout({ ...workout, id });
    return data;
  },

  async remove(id) {
    return { data: { message: 'Workout deleted successfully' } };
  }
};

export default workoutsService;
